import React from "react";
import styled from "styled-components";

const CardArea = styled.div`
    background-color: white;
    box-shadow: 0 2px 8px rgba(0,0,0,0.26);
`



const Card = props => {
    return <CardArea>{props.children}</CardArea>
};

export default Card;
